import React, { useEffect, useState } from 'react';
import axios from 'axios';
  

const Other = () => {

    const [tickets, setTickets] = useState({});

      useEffect(() => {
        const getTickets = async () => {
            const {data: res} = await axios.get('http://localhost:8000/api/lottery-tickets');
            // console.log(res.tickets)
            setTickets(res.tickets);
        }
        getTickets();
      }, [])

    const [randomNumber, setRandomNumber] = useState(0);

    const generateRandomNumber = () => {
        const randomNumber = Math.floor(Math.random() * tickets.lenght);
        setRandomNumber(randomNumber);
    }

    console.log(randomNumber)
    return(
        <>
        <div className='container d-flex admin-panel justify-content-center'>
            <button type='click' onClick={generateRandomNumber}></button>
        </div>
        </>
    )
}

export default Other;
